import "./layout/Main.css";

const Main = () => {
  // 이미지 파일 이름
  const imageName = "43_product_img0_돼지바.png";

  // 이미지 이름 인코딩
  const encodedImageName = encodeURIComponent(imageName);

  return (
    <>
      <div className="main_img"></div>
      <div
        className="img-inlinetest"
        style={{
          width: "300px",
          height: "300px",
          backgroundImage: `url(../images/${encodedImageName})`,
        }}
      ></div>
    </>
  );
};

export default Main;
